/* eslint-disable no-unused-vars */
import React from 'react';
import Jumbotron from 'react-bootstrap/Jumbotron';
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';

export default function Main() {
  return (
    <>
      <Jumbotron>
        <h1>Hello, this is a sleeping app.</h1>
        <p>
          We are here to help mothers to sleep more. Is it possible? Yes, you
          just need to know to to organize sleep of your baby.
        </p>
        <p>
          <Button variant="primary">I want to sleep more!</Button>
        </p>
      </Jumbotron>
      <br />
      <Jumbotron fluid>
        <Container>
          <h1>Fluid jumbotron !</h1>
          <p>
            This is a modified fluid jumbotron which stretches the whole
            horizontal space.
          </p>
          <Button variant="primary">Primary Button</Button>
        </Container>
      </Jumbotron>
    </>
  );
}
